import logo from "../assets/images/kkini_logo.png";
import "../styles/MainPage.css"
function MainPage() {

    return (
        <div className="MainPage">
            <img src={logo} className="logo" alt="kkini logo" />
        </div>
    )
}

export default MainPage;
